乐币/积分 可以通过游戏流水获得，系统会根据会员等级和游戏类型自动计算派发给客户，如下：
体育场/老虎机/彩票LB：
白银会员投注280元=1乐币    
黄金会员级别投注280元=1.2乐币  
铂金会员级别投注280元=1.5乐币

钻石级别投注280元=2乐币  娱乐场/捕鱼游戏：
白银 500元流水=1 乐币;
黄金 500元流水=1.2乐币;
铂金 500元流水=1.5乐币;

钻石500元流水=2乐币娱乐场/必发交易/捕鱼游戏：
白银 500元流水=1 乐币;
黄金 500元流水=1.2乐币;
铂金 500元流水=1.5乐币;
钻石500元流水=2乐币

